// Home.js
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import './App.css';

function Home() {
  const [activeIndex, setActiveIndex] = useState(0);
  const [activeIndex2, setActiveIndex2] = useState(0);
  
  const images = [
    '/Images/image1.jpg',
    '/Images/image2.jpg',
    '/Images/image6.jpg',
    '/Images/image7.jpg'
  ];

  const images2 = [
    '/Images/image3.jpg',
    '/Images/image4.jpg',
    '/Images/image5.jpg'
  ];

  const newsItems = [
    {
      date: "Oct 17, 2024",
      title: "Jane Fonda to Be Honored with the 2024 SAG Life Achievement Award",
      link: "/media/news/releases/jane-fonda-be-honored-2024-sag-life-achievement-award"
    },
    {
      date: "Aug 26, 2024",
      title: "Submissions for the 31st Annual Screen Actors Guild Awards速 are Now Open",
      link: "/media/news/releases/submissions-31st-annual-screen-actors-guild-awardsr-are-now-open"
    },
    {
      date: "Apr 16, 2024",
      title: "Screen Actors Guild Awards速 Sets Date for 2025",
      link: "/media/news/releases/screen-actors-guild-awardsr-sets-date-2025"
    }
  ];

  useEffect(() => {
    const interval = setInterval(() => {
      setActiveIndex((current) => (current + 1) % images.length);
    }, 7000); // Increased from 3000 for longer display time
    return () => clearInterval(interval);
  }, []);

  useEffect(() => {
    const interval = setInterval(() => {
      setActiveIndex2((current) => (current + 1) % images2.length);
    }, 5000); // Reduced from 4000
    return () => clearInterval(interval);
  }, []);

  return (
    <div className="homepage-container">
      {/* First slideshow */}
      <div className="slider-container">
        <div className="slideshow-container">
          <div className="slider-track">
            {images.map((image, index) => (
              <div
                key={index}
                className={`slide ${index === activeIndex ? 'active' : ''}`}
              >
                <img src={image} alt={`Slide ${index + 1}`} />
              </div>
            ))}
          </div>
        </div>
      </div>

      {/* Secondary content with side-by-side layout */}
      <div className="secondary-content">
        <div className="links-box">
          <div className="info-item">
            <Link to="/articles" className="title-link">Articles</Link>
            <span className="link-description">: Profiles and analyses of notable actors.</span>
          </div>
          
          <div className="info-item">
            <Link to="/nominations" className="title-link">Nominations</Link>
            <span className="link-description">: Insights on SAG Awards nominees and achievements.</span>
          </div>
          
          <div className="info-item">
            <Link to="/awards" className="title-link">Awards</Link>
            <span className="link-description">: Recognitions for excellence in various film categories.</span>
          </div>
        </div>

        <div className="slideshow2-container">
          {/* Second slideshow content */}
          <div className="slider-track">
            {images2.map((secondImage, index) => (
              <div
                key={index}
                className={`slide ${index === activeIndex2 ? 'active' : ''}`}
              >
                <img src={secondImage} alt={`Second Slide ${index + 1}`} />
              </div>
            ))}
          </div>
        </div>
      </div>

      <div className="view-content row">
        {newsItems.map((item, index) => (
          <div className="views-row" key={index}>
            <div className="row-list item-{index + 1}">
              <div className="date">
                <time dateTime="00Z" className="datetime">{item.date}</time>
              </div>
              <div className="title">
                <a href={item.link} hrefLang="en">{item.title}</a>
              </div>
            </div>
          </div>
        ))}
      </div>
    </div>
  );
}

export default Home;
